import { minBy } from './minBy';
import { pipe } from './pipe';
var array = [{ a: 2 }, { a: 5 }, { a: 1 }, { a: 3 }];
var expected = { a: 1 };
describe('data first', function () {
    test('minBy', function () {
        expect(minBy(array, function (x) { return x.a; })).toEqual(expected);
    });
    test('minBy.indexed', function () {
        expect(minBy.indexed(array, function (x, idx) { return x.a + idx; })).toEqual({ a: 2 });
    });
});
describe('data last', function () {
    test('minBy', function () {
        var actual = pipe(array, minBy(function (x) { return x.a; }));
        expect(actual).toEqual(expected);
    });
    test('minBy.indexed', function () {
        var actual = pipe(array, minBy.indexed(function (x, idx) { return x.a + idx; }));
        expect(actual).toEqual({ a: 2 });
    });
});
